import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Drawer from '@material-ui/core/Drawer';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import List from '@material-ui/core/List';
import Typography from '@material-ui/core/Typography';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import PeopleIcon from '@material-ui/icons/People';
import MessageIcon from '@material-ui/icons/Message';
import AssignmentIcon from '@material-ui/icons/Assignment';
import WarningIcon from '@material-ui/icons/Warning';
import 'react-date-range/dist/styles.css'; // main style file date range
import 'react-date-range/dist/theme/default.css'; // theme css file date range
import { DateRangePicker } from 'react-date-range'; // date range
import { useState } from 'react';
import classNames from "classnames";
import { Link } from 'react-router-dom';
import Box from '@material-ui/core/Box';
import { Container } from "@material-ui/core";

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
  },
  appBar: {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: drawerWidth,
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  // necessary for content to be below app bar
  toolbar: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.default,
    padding: theme.spacing(3),
  },
  dateRange : {
    marginTop: 50,
    marginBottom: 50
  },
  title: {
    color: "#00000",
    fontSize: 35,
    fontWeight: 600, // or 'bold'
  },
  customContainer: {
    paddingLeft: 108,
    paddingRight: 108,
  }
}));

export default function VendorPastOrders() {
  const classes = useStyles();
  const [dateRange, setDateRange] = useState([
    {
      startDate: new Date(),
      endDate: new Date(),
      key: 'selection'
    }
  ]);

 console.log(dateRange)
//   handleSelect(ranges){ console.log(ranges) }

  return (
    <div className={classes.root}>

      <AppBar position="fixed" className={classes.appBar}>
        <Toolbar>
          <Typography variant="h6" noWrap component={ Link } to="/vendorDashboard">
            Vendor Order Dashboard
          </Typography>
        </Toolbar>
      </AppBar>
      <Drawer
        className={classes.drawer}
        variant="permanent"
        classes={{
          paper: classes.drawerPaper,
        }}
        anchor="left"
      >
        <div className={classes.toolbar} />
        <Divider />
        <List>
          <ListItem component={ Link } to="/vendor/currentOrders" button key={'Current Orders'}>
              <ListItemIcon><WarningIcon /></ListItemIcon>
              <ListItemText primary={'Current Orders'} />
          </ListItem>
          <ListItem component={ Link } to="/vendor/pastOrders" button key={'Past Orders'}>
              <ListItemIcon><PeopleIcon /></ListItemIcon>
              <ListItemText primary={'Past Orders'} />
          </ListItem>
          <ListItem button key={'Messages'}>
              <ListItemIcon><MessageIcon /></ListItemIcon>
              <ListItemText primary={'Messages'} />
          </ListItem>
          <ListItem button key={'My Tasks'}>
              <ListItemIcon><AssignmentIcon /></ListItemIcon>
              <ListItemText primary={'My Tasks'} />
          </ListItem>
        </List>
        <Divider />

      </Drawer>
      <main className={classes.content}>
    <div id="dateRangeBox" width="100%">
      <DateRangePicker
        onChange={item => setDateRange([item.selection])}
        showSelectionPreview={true}
        moveRangeOnFirstSelection={false}
        months={2}
        ranges={dateRange}
        direction="horizontal"
        className={classNames(classes.dateRange)}
      />
      </div>
      <Container className={classNames(classes.customContainer)}>
        <Typography align="left" className={classNames(classes.title)} >
        Past Orders
        </Typography>
        <List>
            {['Order 1', 'Order 2', 'Order 3', 'Order 4'].map((text, index) => (
              <ListItem button key={text}>
                <Box
                display="flex"
                flexWrap="wrap"
                p={1}
                // bgcolor="background.paper"
                justifyContent = 'space-between'
                borderRadius={10}>
                {text}
                </Box>
              </ListItem>
            ))}
          </List>
        </Container>
      </main>
    </div>
  );
}
